s($,"aDo","ane",()=>A.a([A.TK("D'avril 2022 \xe0 aout 2022","CIMPA PLM Services","Architecte Technique Junior","Architecte Technique Junior pour un projet Airbus. J'ai pour mission principale de supporter au quotidien l\u2019\xe9quipe responsable de la consolidation des droits d\u2019acc\xe8s et du data model Airbus."),A.TK("De septembre 2021 \xe0 mars 2022","Capgemini Engineering","Agile Project Manager / D\xe9vellopeur XR","Agile Project Manager et D\xe9veloppeur XR du projet R&I Mobility & Image Analysis (MIA) au sein de Capgemini Engineering. Nous travaillons au sein du projet autour de th\xe9matiques telles que la Vision par Ordinateur, la Robotique, l'Intelligence Artificielle, et l'Ergonomie. Mes travaux sont centr\xe9s sur la m\xe9thodologie Agile, plus pr\xe9cis\xe9ment autour des Framework Scrum et MAHD. En terme de d\xe9veloppement je travaille avec Swift en r\xe9alit\xe9 augment\xe9 et AR Kit."),A.TK("D'avril 2021 \xe0 juillet 2021","Diota","D\xe9veloppeur software C++","L\u2019objectif du projet est d\u2019ajouter la possibilit\xe9 d\u2019interagir avec le logiciel 'Diota AppFactory' gr\xe2ce \xe0 la reconnaissance vocale. Le projet est cod\xe9 en C++, Qt qml, compatible Windows, IOS et android."),A.TK("De juillet 2020 \xe0 d\xe9cembre 2020","Altran Technologies","Stagiaire XR","D\xe9veloppement Unity3D, HoloLens, XR, Python, Sujet smartCity. Stagiaire dans le service Digital Engineering d'Altran, dans l'\xe9quipe AR/VR, charg\xe9 de concevoir et d\xe9velopper des solutions 3D pour un projet iconique Altran sur la ville du futur en r\xe9alit\xe9 virtuelle et augmenter.")],A.R("q<E_>")))
r($,"aDp","aeH",()=>A.a([A.l_("L'Area est un projet qui consiste en la cr\xe9ation d'un site web et d'une application mobile avec une API Rest pour cr\xe9er des 'actions' et 'r\xe9actions' autour d'APIs.","Area - Flutter"),A.l_("Balthazar est un assistant personnel inspir\xe9 par Jarvis des films 'Iron Man'. Il a une autonomie totale dans son fonctionnement et marchera en coh\xe9sion avec mon mode de vie personnel en plus d'\xeatre enti\xe8rement param\xe9trable.","Balthazar The personal assistant - Flutter"),A.l_("Le but de ce projet est de cr\xe9er un bot de trading pour gagner le plus d'argent possible. Concr\xe8tement, la mission de ce bot est d'\xe9valuer la cotation d'une action, et de r\xe9agir en d\xe9cidant d'acheter ou de vendre, par un processus automatis\xe9.","Trade bot - Python"),A.l_("Pour cr\xe9er un bomberman complet en 3D nous avons d\xe9cid\xe9 de refaire enti\xe8rement un moteur de jeu en C++ avec OpenGL. Le moteur est compos\xe9 d'une architecture 'ECS', un chargement de mod\xe8les glTF, un moteur physique utilisant 'Bullet3' et un syst\xe8me de plugins permettant d'acc\xe9der uniquement aux fonctionnalit\xe9s dont vous avez besoin.","Bomberman - C++"),A.l_("Gr\xe2ce \xe0 diff\xe9rentes API nous voulons cr\xe9er un Dashboard utile dans la vie de tous les jours. Pour cela nous avons cr\xe9er une application capable de rendre l\u2019utilisation du dashboard plus pratique, efficace et ludique. Et pour aller plus loin, nous avons cr\xe9\xe9 une Rest API avec une authentification \xe0 double facteur pour mieux utiliser les API.","Dashboard - React"),A.l_("L'Arcade \xe0 pour but de r\xe9aliser un programme capable de changer de librairies dynamiquement avec un haut niveau d'abstraction, le noyau de l'application ne doit jamais conna\xeetre ni le jeu en cours ni la librairie graphique utilis\xe9e. Les librairies graphiques utilis\xe9es sont la SDL, la SFML et la Ncurses. Pour utiliser notre arcade vous pouvez jouer \xe0 pacman et \xe0 un snake.","Arcade - C++"),A.l_("Un projet qui utilise l'API de reddit pour faire une application mobile qui ressemble \xe0 reddit mais avec notre design ! Nous utilisons une authentification \xe0 plusieurs facteurs avec un bot de mail et une Rest API fait main.","Redditech - Flutter"),A.l_("Guild Dungeon est un jeu vid\xe9o en d\xe9veloppement depuis 1 ans. Dans Guild Dungeon, vous incarnez un ma\xeetre de guilde qui va explorer le monde pour devenir la guilde la plus puissante du monde.","GuildDungeon - Unity, C#"),A.l_("Le but de ce projet est de cr\xe9er son propre RPG, sachant que le principal d\xe9fi pour ce jeu est de cr\xe9er un produit complet en C. Pour cela nous avons d\xe9velopp\xe9 un moteur de jeu complet 'ECS' en C.","RPG - C")],A.R("q<GF>")))
